INSERT INTO applications (id, application_name, application_description, application_tosca_template, application_version, status_id, organization_id, application_tosca_name, application_process) VALUES (3604, 'clll', 'jgjgj', NULL, '1', 3, NULL, 'clearo', NULL);
INSERT INTO applications (id, application_name, application_description, application_tosca_template, application_version, status_id, organization_id, application_tosca_name, application_process) VALUES (195, 'Next2Me', 'NextToMe is an application offered by the Barcelona City Council that allows the citizen to find services and events occurring around him. The objective is to develop a mobile solution that looks for nearby services and public facilities, allowing the user to filter them by category of the service/event or to look for a specific one. The application provides a list of services and facilities, geo-location of the user and a map of the services and facilities.
INSERT INTO applications (id, application_name, application_description, application_tosca_template, application_version, status_id, organization_id, application_tosca_name, application_process) VALUES (199, 'MobileID', 'The mobile digital-identity system is a cryptographic authentication service performed through a digital-identity application for citizens, downloaded to a mobile telephone device with access to the Internet under the owners control, in accordance with the current legislation. The system enables the user, among other things, to communicate with services of the administration and third parties that use this digital-identity authentication system.', '', '2', 2, NULL, NULL, NULL);
INSERT INTO applications (id, application_name, application_description, application_tosca_template, application_version, status_id, organization_id, application_tosca_name, application_process) VALUES (239, 'Energy Consumption - Corby', 'The service transforms a home (or business premises) into a smart space where the power, lighting and heating can be controlled from a smartphone or tablet. In addition, electricity use and pre-set options can be monitored to manage lighting or powered devices to meet the space requirements or reduce energy consumption.', '', '1', 1, NULL, NULL, NULL);
INSERT INTO applications (id, application_name, application_description, application_tosca_template, application_version, status_id, organization_id, application_tosca_name, application_process) VALUES (243, 'BusPortal - Corby', 'The Northamptonshire Bus Portal is an online website designed to help users plan their journey more easily. The service will be developed taking into account Northamptonshires ambition of accelerating modal shift which will result in greater public transport use. Expanding information on public services to an online platform is also part of Northamptonshire Transportation Plan of 2012. The service will be developed by TeamNet using Northamptonshire County Council data.', '', '3', 3, NULL, NULL, NULL);
INSERT INTO applications (id, application_name, application_description, application_tosca_template, application_version, status_id, organization_id, application_tosca_name, application_process) VALUES (236, 'MIB', 'MIB is a service that....', '', '1', 1, NULL, NULL, NULL);
INSERT INTO applications (id, application_name, application_description, application_tosca_template, application_version, status_id, organization_id, application_tosca_name, application_process) VALUES (182, 'Agenda', 'City Agenda is a service offered by Barcelona City Council that aims to increase the citizen participation by keeping them updated with the schedule of the events. The objective is to develop a mobile solution that allows the users to look for cultural and leisure events by theme happening in Barcelona. The application provides a list of events occurring within an established distance, geo-location of the user, map of events, search tool for events and possibility of highlighting events.', '', '3', 3, NULL, NULL, NULL);
INSERT INTO applications (id, application_name, application_description, application_tosca_template, application_version, status_id, organization_id, application_tosca_name, application_process) VALUES (181, 'FixThis', 'Fix This is an application set to ease the interaction among the citizens and the city council. The objective is to develop a mobile solution where citizens can report geo-located incidences with their smartphones, which are automatically sent to the incidents systems of the Public Administration for reporting and then take corrective actions. The application provides a list of possible incidences, geo-location of the user, record of incidences sent by the user and status of them.', '', '2', 2, NULL, NULL, NULL);
